import {
    Avatar,
    Box,
    Card,
    CardContent,
    Grid,
    Typography
  } from '@material-ui/core';
  import { red } from '@material-ui/core/colors';

  const Budget = ({totalPonts}) => (
    <Card
      sx={{ height: '100%' }}
    >
      <CardContent>
        <Grid
          container
          spacing={3}
          sx={{ justifyContent: 'space-between' }}
        >
          <Grid item>
            <Typography
              color="textSecondary"
              gutterBottom
              variant="h6"
            >
              TOTAL POINTS
            </Typography>
            <Typography
              color="textPrimary"
              variant="h3"
            >
              {totalPonts}
            </Typography>
          </Grid>
          <Grid item>
          </Grid>
        </Grid>
        <Box
          sx={{
            pt: 2,
            display: 'flex',
            alignItems: 'center'
          }}
        >
        </Box>
      </CardContent>
    </Card>
  );
  
  export default Budget;
